import './App.css';
import Banner from './components/Banner';
import banner1 from "./assets/images/banner-1.png"
import Header from './components/Header';

function App() {
  return (
    <div className="App">
        <Header id="header" />
        <Banner title="true" image={banner1}/>
    </div>
  );
}

export default App;
